import React from "react";
import { render } from "react-dom";


function CoinCard (){

    return(

        <div className="CoinCard">
            
            <div>
                <img/>
            </div>
            <div>
                <h2>token Name</h2>
                <h3>token Symbol</h3>
            </div>
            <div>
                <h2>Token Price</h2>
                <h3>Token detail</h3>
            </div>
            
        </div>
    )
}

export default CoinCard
